import { Component } from "react";
const styles = {
    logo: {
        color: '#3e2623',
        marginBottom:'30px',
    }
}

class Logo extends Component{
    render() {
        return (
          <h1 style={styles.logo}>Nuestros productos</h1>  
        )
    }
}
export default Logo
